import React, { Component } from 'react';

import './style.css';

import my from'./img/my photo/my.jpg';
import html from './img/skills/html.png';
import css from './img/skills/css.png';
import js from './img/skills/js.png';

class Skills extends Component {
    state = {}
    render() {
        return ( 
            <div className="page2">
                
            <div className="partTop">
                <img className="photo" src={my} alt="myPhoto"></img>
                <font className="data">Shnouda Youssef</font>
            </div>
            <div className="partbottom">
                <div className="htm">
                    <img className="htm1" src={html} alt="HTML"></img>
                    <div className="htm2">
                        <font className="htmlfont text-dark">HTML</font>
                        <div className='bg-danger'> <div className="htmlline"></div> </div>
                    </div>
                </div>
                <div className="cs">
                    <img className="cs1" src={css} alt="CSS"></img>
                    <div className="cs2 bg-danger">
                        <font className="csfont text-dark">CSS</font>
                        <div className="csline">
                        </div>
                    </div>
                </div>
                <div className="js">
                    <img className="js1" src={js} alt="JavaScript"></img>
                    <div className="js2 bg-danger">
                        <font className="jsfont text-dark">JavaScript</font>
                        <div className="jsline">
                        </div>
                    </div>
                </div>
            </div>
        </div>
        );
    }
}

export default Skills;
